s.x:
var $bm_rt;
var flop;
try {
    var eff = thisComp.layer(thisLayer(2)('Admin')(2)('A')(2)(1)._name)(4)('RubberHose 2');
    var bendDir = eff('Bend Direction');
    var autoFlop = eff('AutoFlop');
    flop = bendDir > 0 ? 1 : -1;
    autoFlop > 0 ? 0 : flop *= -1;
    var s = flop == 1 ? [
            -100,
            100
        ] : [
            100,
            100
        ];
    if (eff('Parent Scale') < 0) {
        s = [
            -s[0],
            s[1]
        ];
    }
    $bm_rt = s;
} catch (err) {
    $bm_rt = value;
}
